onsider \"designs\" for how data are to be collected, and rally the computational resources to execute their plans. Along the way they will grapple with questions related to the nature of data (its representation, formats and protocols for sharing) and of algorithms (rules governing data collection, strategies for analysis). Students will learn about classical themes in Computer Science, from databases to networking, as well as lessons in Statistics, from visualization to basic inference. <\/p> <h2> For more information, visit Mobilize at <a href='http://www.mobilizingcs.org/'>www.mobilizingcs.org<\/a> <\/h2>",YNd="<h1><font color='#00bee7'>PARTICIPATE. VISUALIZE. CHANGE.<\/font><\/h1> <h2>What is ohmage?<\/h2> <p> <b>ohmage<\/b> is an open source participatory sensing technology platform. It supports expressive campaign authoring; mobile phone-based data capture through both inquiry-based surveys and automated data capture as well as temporally/spatially triggered reminders, data visualization and real-time feedback; privacy respecting data management; and extensible data exploration. All captured data are automatically timestamped, geocoded and uploaded for analysis and visualization. <\/p> <p> This platform is used in pilot health studies and as a pedagogical tool in LAUSD schools for learning data representation, collection and analysis. <\/p> <h2> For more information, visit <a href='http://www.ohmage.org/'>www.ohmage.org<\/a>, <a href='http://demo.ohmage.org/'>demo.ohmage.org<\/a> and <a href='http://www.mobilizingcs.org/'>http://www.mobilizingcs.org/<\/a>. <\/h2>",iyd="<h1>Create your ohmage account in seconds<\/h1> <h2><span id='",hxd="<h1>Forgot your login?<\/h1> <h3>We can reset your ohmage password if you have your <b>username and email address<\/b> associated with your account. If you did not provide an email address or forgot your username, please contact your supervisor for assistance.<\/h3> <br>  <span id='",lyd="<h1>Just one more step...<\/h1>  <span
